// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import TimetableView from './components/TimetableView';
import TimetableEdit from './components/TimetableEdit';
import AllCourses from './components/AllCourses'; // Import the AllCourses component

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/courses">All Courses</Link> {/* Link to All Courses */}
            </li>
          </ul>
        </nav>

        <Route path="/" exact component={TimetableView} />
        <Route path="/edit" component={TimetableEdit} />
        <Route path="/courses" component={AllCourses} /> {/* Route to All Courses */}
      </div>
    </Router>
  );
}

export default App;
